  }, ": \uBE44\uACF5\uAC1C\uB85C \uB0A8\uC544\uC788\uC5C8\uB358 \uAE00")), mdx("hr", null), mdx("p", null, "2013\uB144 1\uC6D4 15\uC77C. \uC0C8\uD574\uAC00 \uC2DC\uC791\uD55C\uC9C0\uB3C4 \uBC8C\uC368 \uBCF4\uB984\uC774\uB098 \uC9C0\uB0AC\uB2E4. \uC0C8\uB85C\uC6B8 \uAC83\uC774\uB77C\uACE0\uB294 \uC5C6\uB294 \uD3C9\uBC94\uD558\uC9C0\uB3C4, \uD3C9\uBC94\uD558\uC9C0 \uC54A\uC9C0\uB3C4 \uC54A\uC740 \uC0DD\uD65C\uC744 \uD558\uACE0 \uC788\uB2E4. \uD68C\uC0AC\uC5D0\uC11C\uB3C4, \uC9D1\uC5D0\uC11C\uB3C4 \uB9E4\uC77C \uB611\uAC19\uC740 \uBC18\uBCF5\uC801\uC778 \uC77C\uB4E4\uB9CC \uB418\uD480\uC774\uB418\uACE0 \uC788\uB294 \uAC83\uC774\uB2E4. \uAC00\uB054\uC2DD \uC77C\uC5B4\uB098\uB294 \uC0AC\uAC74\uB4E4\uB3C4 \uB300\uC218\uB86D\uC9C0 \uC54A\uAC8C \uC77C\uC0C1\uC18D\uC5D0 \uBB3B\uD788\uACE0 \uC9C0\uB098\uAC00\uBC84\uB9B0\uB2E4. \uC601\uD6C8\uC774\uC758 \uC2DC\uB828\uACFC \uC0C1\uD6C8\uC774\uC758 \uACF5\uBC31\uC774 \uC591\uCABD\uC5D0\uC11C\uC758 \uD2B9\uBCC4\uD55C \uC77C\uC774\uB77C\uBA74 \uC77C\uC774\uACA0\uB2E4. \uD68C\uC0AC \uCD9C\uADFC\uC774 \uAC08\uC218\uB85D \uB2A6\uC5B4\uC9C0\uACE0 \uC788\uB294 \uAC83\uC744 \uBCF4\uBA74, \uB098\uC758 \uC0DD\uD65C \uD0DC\uB3C4\uC640 \uC5F4\uC815\uC5D0 \uB300\uD574\uC11C \uC605\uBCFC \uC218 \uC788\uC73C\uB9AC\uB77C. \uB864\uC5D0 \uBE60\uC838 \uC0B4\uB358 \uC2DC\uAE30\uAC00 \uC9C0\uB098\uACE0, \uACF5\uBC31\uC758 \uC2DC\uAC04\uC5D0 \uD765\uBBF8\uB85C\uC6B4 \uAC83\uC744 \uCC3E\uC9C0 \uBABB\uD574 \uB610 \uB2E4\uC2DC \uAC8C\uC784 \uC18D\uC5D0 \uBE60\uC838\uC0B4\uC558\uB2E4. \uC5EC\uC720\uC758 \uC2DC\uAC04\uB3C4 \uC7AC\uBBF8\uC758 \uC2DC\uAC04, \uD765\uBBF8\uC758 \uC2DC\uAC04\uB3C4 \uC5C6\uC774 \uAC8C\uC784 \uC18D\uC758 \uBAA9\uD45C\uC640 \uC0DD\uD65C\uB9CC \uCAD3\uC544\uAC14\uB2E4. \uB098\uC758 \uC2E4\uC81C \uC0DD\uD65C\uC740 \uC5B4\uB5A4\uAC00. \uC0AC\uB78C\uACFC\uC758 \uB2E8\uC808, \uB098 \uD63C\uC790\uB9CC\uC758 \uC2DC\uAC04, \uC0C1\uD6C8\uC774\uC640\uC758 \uAC08\uB4F1, \uD68C\uC0AC\uC5D0\uC11C\uB294 \uB300\uAE30\uC5C5\uC5D0\uC11C \uD558\uB4EF\uC774 \uD558\uACE0, \uC0C8\uB85C\uC6B4 \uC0AC\uB78C\uC744 \uC548\uB9CC\uC9C0\uAC00 \uC218\uB144\uC774 \uB418\uC5C8\uB2E4. \uB0B4 \uB098\uC774 29. 20\uB300\uC758 \uB098\uC758 \uBAA8\uC2B5\uC744 \uC5B4\uB5A0\uD588\uB294\uAC00. \uB300\uD559\uAD50 \uC878\uC5C5, \uAD70\uB300 \uC81C\uB300, \uC2A4\uD0C0\uD2B8\uC5C5\uC758 \uC2DC\uC791\uACFC \uB05D\uC758 \uBA87 \uBC88. \uC5F4\uC815\uC744 \uB2E4\uD588\uC744 \uB54C\uAC00 \uC190\uC5D0 \uAF3D\uC744 \uC815\uB3C4\uBC16\uC5D0 \uC548\uB41C\uB2E4. \uB09C \uC624\uB298\uB3C4 \uADF8\uB0E5 \uC9C0\uB0B8\uB2E4. \uD638\uAE30\uC2EC \uC5B4\uB9B0 \uB208\uB3C4 \uC5C6\uACE0, \uBC30\uC6C0\uC5D0 \uB300\uD55C \uAC08\uB9DD\uB3C4 \uC5C6\uB294 \uAC83 \uAC19\uB2E4. \uBC30\uB97C \uC7A1\uACE0 \uC6C3\uC744 \uC77C\uB3C4 \uC904\uC5C8\uACE0, \uC0AC\uB78C\uB4E4\uACFC\uC758 \uB300\uD654\uC640 \uC18C\uD1B5\uB3C4 \uB9CE\uC774 \uC904\uC5C8\uB2E4. \uC0C8\uB85C\uC6B4 \uC0AC\uB78C\uC744 \uB9CC\uB098\uB294 \uAC83\uB3C4 \uC544\uC9C1 \uD798\uB4E4\uACE0, \uC990\uAC81\uAC8C \uB178\uB294 \uAC83\uB3C4 \uC544\uC9C1 \uBD88\uC548\uD558\uACE0 \uD798\uACB9\uB2E4. \uB098\uC758 \uBC29\uD5A5\uACFC \uBAA9\uD45C\uC5D0 \uB300\uD574\uC11C\uB3C4 \uD750\uB9BF\uD574\uC84C\uACE0, \uC790\uAE30\uACC4\uBC1C, \uB3C5\uC11C, \uC6B4\uB3D9 \uC2DC\uAC04\uB3C4 \uB208\uC5D0 \uB744\uAC8C \uC904\uC5C8\uB2E4. \uB098\uC640 \uAC19\uC774 \uC0B4\uACE0, \uB098\uC640 \uAC19\uC774 \uC77C\uD558\uB294 \uC0AC\uB78C\uB4E4\uC740 \uB098\uB97C \uBCF4\uACE0 \uC5BC\uB9C8\uB098 \uC548\uD0C0\uAE5D\uACE0 \uC2E4\uB9DD\uD588\uC744\uAE4C. \uB098\uC870\uCC28\uB3C4 \uB098\uC758 \uBAA8\uC2B5\uC774 \uD0D0\uD0C1\uCE58 \uC54A\uAC8C \uC0DD\uAC01\uC774 \uB4DC\uB294\uB370, \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC740 \uC5B4\uB560\uC744\uAE4C. \uAD1C\uC2DC\uB9AC \uAD1C\uCC2E\uC740 \uCC99 \uD558\uACE0 \uB2E4\uB2C8\uC9C0\uB9CC, \uB0B4\uBD80\uB85C\uBD80\uD130 \uB4E4\uC5B4\uB098\uB294 \uBD84\uC704\uAE30\uB098 \uD750\uB824\uC9C4 \uB208\uB3D9\uC790\uB9CC \uBD10\uB3C4 \uC54C \uAC83\uC774\uB2E4. \uB204\uAD6C\uB97C \uC704\uD574 \uC0B4\uACE0, \uBB34\uC5C7\uC744 \uC704\uD574 \uC0B4\uC544\uC57C\uD558\uB294 \uAC83\uC77C\uAE4C. \uC608\uC804\uC5D0\uB294 \uC54C\uC558\uB358 \uAC83 \uAC19\uC740\uB370 \uC9C0\uAE08\uC740 \uC798 \uAE30\uC5B5\uC774 \uB098\uC9C0 \uC54A\uB294\uB2E4. \uB9C9\uC5F0\uD788 \uB0A8\uC758 \uBAA9\uD45C\uB9CC \uCAD3\uC544\uAC00\uACE0, \uB098\uC758 \uBAA9\uD45C\uC778\uC591 \uD55C \uAC83\uC740 \uC544\uB2D0\uAE4C. \uC0C1\uD6C8\uC774\uAC00 \uB9D0\uD558\uB294 \uB098\uC758 \u2018\uC9C4\uC2EC\u2019\uC740 \uB3C4\uB300\uCCB4 \uC5B4\uB514\uC5D0 \uC788\uB294 \uAC83\uC77C\uAC00. \uC9C4\uC2EC\uC778\uC591 \uD3EC\uC7A5\uD558\uACE0 \uC788\uB294 \uB098\uC758 \u2018\uAC00\uC9DC\u2019 \uB9C8\uC74C\uC740 \uBB34\uC5C7\uC77C\uAE4C. \uB0B4\uAC00 \uC9C4\uC815\uC73C\uB85C \uC6D0\uD558\uB294 \uAC83\uC740 \uBB34\uC5C8\uC77C\uAE4C. \uB450\uB824\uC6C0\uC5D0 \uC55E\uC5D0\uC11C \uAC10\uCD94\uACE0 \uC788\uB294 \uB098\uC758 \uBC14\uB7A8\uC740 \uBB34\uC5C7\uC77C\uAE4C. \uB09C \uBB34\uC5C7\uC744 \uD558\uBA74 \uD589\uBCF5\uD560 \uC218 \uC788\uC744\uAE4C. \uBB34\uC5C7\uC744 \uD560 \uB54C \uD589\uBCF5\uD588\uB294\uAC00. \uAC8C\uC784 \uC18D\uC758 \uD589\uBCF5\uB3C4 \uD589\uBCF5\uC774\uB77C \uD560 \uC218 \uC788\uB294\uAC00. \uC7A5\uAE30\uC801\uC778 \uAD00\uC810\uC5D0\uC11C \uBCFC \uB54C \uB098\uB294 \uC9C0\uAE08 \uBB34\uC5C7\uC744 \uD574\uC57C\uD558\uB294\uAC00."));
